import React from 'react';
import NearMeIcon from '@mui/icons-material/NearMe';
import PermMediaIcon from '@mui/icons-material/PermMedia';

const Choose = () => {
    return (
        <>
            <section>
                <div>
                    <div>
                        <NearMeIcon />
                    </div>

                </div>
            </section>
        </>
    );
};

export default Choose;
